script: |
  super -f tsv -I q5128.sql | sort > q5128.out

vector: true

inputs:
  - name: q5128.sql
    data: |
      SELECT DISTINCT + COUNT ( * ) * 86 FROM tab0 WHERE NOT - col2 NOT BETWEEN + - col1 * - 93 + + - ( - col0 ) / col1 * - col0 + - col2 AND + col2;
  - name: tab0

outputs:
  - name: q5128.out
    data: |
      86
